export function Username(props)
{
  const handleChange = (event) => 
  {
    props.handleChange(event);
  }

  return (
    <div class="col-md-4">
      <label for="validationCustomUsername" class="form-label">Username</label>
      <div class="input-group has-validation">
        <span class="input-group-text" id="inputGroupPrepend">@</span>
        <input 
          type="text" 
          name="username"
          defaultValue={props.default}
          onChange={handleChange}
          class="form-control" 
          id="validationCustomUsername" 
          aria-describedby="inputGroupPrepend"
          required={props.required} />
      </div>
    </div>
  );
}

export function Password(props)
{
  const handleChange = (event) => 
  {
    props.handleChange(event);
  }

  return (
    <div class="col-md-6">
    <label for="validationCustom03" class="form-label">Password
    <input 
      class="form-control" 
      id="validationCustom03" 
      type="password" 
      name="password1"
      defaultValue={props.default}
      onChange={handleChange}                
      required={props.required}/>
    </label>
  </div>
  );
}

export function PasswordVerify(props){

  const handleChange = (event) => 
  {
    props.handleChange(event);
  }

  return (
    <div class="col-md-6">
    <label for="validationCustom04" class="form-label">Verify Password
    <input 
      class="form-control" 
      id="validationCustom04" 
      type="password" 
      name="password2"
      defaultValue={props.default}
      onChange={handleChange}                
      required={props.required}/>
    </label>
  </div>
  );
}

export function Email(props)
{
  const handleChange = (event) => 
  {
    props.handleChange(event);
  }

  return (
    <div class="col-md-6">
    <label for="validationCustom02" class="form-label">Email</label>
    <input 
      type="email" 
      name="email"
      onChange={handleChange}
      class="form-control" 
      id="validationCustom02"
      defaultValue={props.default}
      required={props.required}/>
    </div>
  );
}

export function Phone(props)
{
  const handleChange = (event) => 
  {
    props.handleChange(event);
  }
  return (
    <div class="col-md-6">
      <label for="validationCustom05" class="form-label">Phone Number</label>
      <input 
        type="text" 
        class="form-control"
        name="phone"
        defaultValue={props.default}
        onChange={handleChange}
        id="validationCustom05"
        required={props.required}/>
    </div>
  );
}
